- input: "TEXT\x1CC00521427\x1C.TEXT\x1C\x1CF3XN\x1CSee Misc-99 Statement filed contemporaneously
    with this report regarding the in-kind contributions from certain vendors for
    the resolution of certain debts previously reported by the committee.  With respect
    to the two disputed debts (Transaction ID: SD10.4346 and SD10.4190) the amounts
    reported are the sum totals that the creditor Craft DC states that the Committee
    owes. Disclosure of debt is not an admission of amount owed.  The amount of debt
    is disputed in full and the Committee does not admit to owing any funds to Craft
    DC.  Specifically regarding Transaction ID: SD10.4346 the Committee paid $1000
    to Craft DC on 1/22/2013 related to this debt. As of the filing of this report
    the Committee has not paid any additional funds to Craft DC for debts that are
    disputed.  Except for the 1/22/2013 payment no other expenditure to Craft DC reported
    on Schedule B Line 21b of this report and other reports previously filed with
    the Commission were payments toward the disputed debt.\n"
